import React from 'react';
import { Link } from 'react-router-dom';
import { Links } from '../tools/Links';


export default function NavLink (){
    return(
        <div>
            <ul className="flex justify-end space-x-9 items-center w-full h-full">
            {Links.map((link, index)=>(
              <li key={index} className='no-underline left-[500px] hover:underline'>
                <Link to={link.path}  
                      className="text-dark text-lg font-semibold hover:text-slate-700">
                        {link.text}
                </Link>
              </li>
            ))}
          </ul>
          <div className="">
                    <Button />
                </div>
        </div>
        
          
    )
}
